import React from 'react'

export default function Home() {
  // const img="https://t3.ftcdn.net/jpg/02/65/16/98/360_F_265169821_CnQKJoI8Aifk4gNdJJPCRNOgCty2E4JH.jpg"
  return (
    <div style={{backgroundImage:"url('https://t3.ftcdn.net/jpg/02/65/16/98/360_F_265169821_CnQKJoI8Aifk4gNdJJPCRNOgCty2E4JH.jpg')",backgroundRepeat:'no-repeat',height:1200}}>
      {/* <h1 style={{textAlign:'center'}}>Home Page</h1> */}
        
          <div style={{width:'25%',marginLeft:20,marginRight:20,backgroundColor:'lightsteelblue'}}>
            <div style={{marginLeft:20,fontFamily:'times new roaman'}}>
              <h2>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A restaurant is a place where cooked food is sold to the public, and where people sit down to eat it.
                It is also a place where people go to enjoy the time and to eat a meal.
                Some restaurants are a chain, meaning that there are restaurants which have the same name and serve 
                the same food. McDonald's, Burger King, and Pizza Hut are examples of chain restaurants that are all
                over the world. These restaurants serve fast food, that is, inexpensive food, prepared and served quickly.
              </h2>
            </div>
          </div>
        
    </div>
  )
}
